import React from "react";

const Search = () => {
  return (
    <>
      <form>
        <input
          type="search"
          placeholder="Search City..."
          className="search-form"
        />
        <input type="submit" value="Search" className="btn btn-primary" />
      </form>
    </>
  );
};

export default Search;
